import React from 'react';
import { CardTitle, Row, Col, CardImg } from 'reactstrap'

const MovieList = props => {
    return (
        <Row>
            <Col xs="12">
                <CardTitle>{props.title}</CardTitle>
            </Col>
            {
                props.listMovie?.map((item) => (
                    <Col>
                        <CardImg style={{ backgroundImage: `https://image.tmdb.org/t/p/original/${item.poster_path}` }} />
                    </Col>
                ))
            }
        </Row>
    );
}

export default MovieList;
